import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { ReactComponent as JavaIcon } from './icons/java.svg';
import { ReactComponent as PythonIcon } from './icons/python.svg';
import { SvgIcon, Box } from '@material-ui/core';
import styles from './Skills.module.css'
import cx from 'classnames';


function generate(element) {
  return [0, 1, 2].map((value) =>
    React.cloneElement(element, {
      key: value,
    }),
  );
}

export default function Skills() {
//   const classes = useStyles();

  return (
    <div>
      <Grid container>
        <Box boxShadow={1} className={styles.header} fontWeight="bold" display="flex">
        <Typography variant="h5" className={cx(styles.text, styles.ty)}>Skills</Typography> 
        <Grid item xs={6} md={6}>
        <Typography variant="h6" className={cx(styles.text, styles.ty)}>Languages</Typography> 
          <div>
            <Box display="flex" flexDirection="row"  bgcolor="white">
                <Box p={1}>
                Item 1
                </Box>
                <Box p={1} bgcolor="grey.300">
                Item 2
                </Box>
                <Box p={1} bgcolor="grey.300">
                Item 3
                </Box>
            </Box>
            <Box display="flex" flexDirection="row-reverse" p={1} m={1} bgcolor="background.paper">
                <Box p={1} bgcolor="grey.300">
                Item 1
                </Box>
                <Box p={1} bgcolor="grey.300">
                Item 2
                </Box>
                <Box p={1} bgcolor="grey.300">
                Item 3
                </Box>
            </Box>
          </div>
        </Grid>
        </Box>
      </Grid>

    </div>
  );
}
